import React, { useEffect } from "react";
import "./Home.css";

const Shery = () => {
  const [Shery, setShery] = React.useState(null);

  useEffect(() => {
    const script = document.createElement("script");
    script.src = "path/to/shery.min.js"; // replace with the actual path to the Shery library
    script.async = true;
    script.onload = () => {
      setShery(window.Shery);
    };
    document.body.appendChild(script);
  }, []);

  if (!Shery) {
    return <div>Loading...</div>;
  }

  useEffect(() => {
    Shery.imageEffect("#back", {
      style: 5,
      config: {
        a: { value: 2, range: [0, 30] },
        b: { value: 0.98, range: [-1, 1] },
        zindex: { value: -9996999, range: [-9999999, 9999999] },
        aspect: { value: 2.0266808951746484 },
        gooey: { value: true },
        infiniteGooey: { value: true },
        growSize: { value: 4, range: [1, 15] },
        durationOut: { value: 1, range: [0.1, 5] },
        durationIn: { value: 1.5, range: [0.1, 5] },
        displaceAmount: { value: 0.5 },
        masker: { value: true },
        maskVal: { value: 1, range: [1, 5] },
        scrollType: { value: 0 },
        geoVertex: { range: [1, 64], value: 1 },
        noEffectGooey: { value: false },
        onMouse: { value: 1 },
        noise_speed: { value: 0.2, range: [0, 10] },
        metaball: { value: 0.18, range: [0, 2] },
        discard_threshold: { value: 0.5, range: [0, 1] },
        antialias_threshold: { value: 0, range: [0, 0.1] },
        noise_height: { value: 0.5, range: [0, 2] },
        noise_scale: { value: 10, range: [0, 100] },
      },
      gooey: true,
    });
  }, [Shery]);

    return (
      <div id="main">
        <div id="back">
          <img className="img" src="1.jpg" alt="#" />
          <img className="img" src="../../assets/2.jpg" alt="#" />
          <img className="img" src="../../assets/3.jpg" alt="#" />
          <img className="img" src="../../assets/4.jpg" alt="#" />
          <img className="img" src="../../assets/5.jpg" alt="#" />
        </div>
        <div id="top">
          <div id="working">
            <div id="nav">
              <div id="nleft">
                <img src="raybanlogo.png" alt="" />
                <a href="#">About</a>
                <a href="#">Products</a>
              </div>
              <div id="nright">
                <a href="#">Services</a>
                <a href="#">Contact</a>
              </div>
            </div>
            <div id="hero">
              <div id="heroleft">
                <div className="elem">
                  <h1>Hey!! </h1>
                  <h1>a </h1>
                  <h1> </h1>
                  <h1></h1>
                </div>
                <div className="elem">
                  <h1>My Name is</h1>
                  <h1>Web </h1>
                  <h1>Android</h1>
                  <h1>Software</h1>
                </div>
                <div className="elem">
                  <h1>Keshav</h1>
                  <h1>Developer</h1>
                  <h1>Developer</h1>
                  <h1>Developer</h1>
                </div>
                <button>Explore Now</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }

  export default Shery;
